Travis joins the DuWest team after starting his real estate career working in Fort Worth and the surrounding communities.  His primary focus is leasing the DuWest shopping centers and helping his clients expand their respective businesses.  Travis was born and raised along the Central Coast of California and went to the University of Arizona on a football scholarship.  He is a three-time letterwinner in Football at the University of Arizona and earned a degree in Regional Development.  Shortly after moving to DFW, Travis decided to pursue a career in College Football and became a Graduate Assistant Football Coach for The University of North Texas.  During which time, he received his Masters Degree.  He enjoyed his time coaching football but decided to pursue a career in Real Estate… and Here We Are!

In his free time, he enjoys cooking/grilling, camping, golfing, and just hanging out with family and friends.

