Taylor is a crucial member of the Project Leasing team here at DuWest Realty, which leases over 4,200,000 SF of real estate in the Southwest. In his time with DuWest, Taylor has listed a variety of retail ranging from single tenant buildings, to neighborhood strips, to a Million SF Power Centers as well as pre-leasing ground up developments. Throughout his real estate career, Taylor has completed over 120 leases and sale transactions.

He began working for DuWest in 2013, after graduating from Texas Tech University with bachelor’s degree in Marketing. Prior to Texas Tech, Taylor played Division 1 soccer at Oral Roberts University in Tulsa, Oklahoma. Taylor is active member in the International Council of Shopping Centers and NTCAR. In his spare time, he enjoys golfing, skiing and traveling.

